import React from 'react';
import { BarChart3, RefreshCw, Settings } from 'lucide-react';
import { ScoreData, MeetingConfig } from '../types';

interface ScorecardScreenProps {
  scoreData: ScoreData | null;
  config?: MeetingConfig;
  onRefresh: () => void;
  loading: boolean;
  error: string | null;
}

const ScorecardScreen: React.FC<ScorecardScreenProps> = ({
  scoreData,
  config,
  onRefresh,
  loading,
  error
}) => {
  return (
    <div className="max-w-4xl mx-auto">
      <div className="bg-white rounded-lg p-8 shadow-lg border border-gray-200">
        <div className="flex items-center justify-between mb-6">
          <div className="flex items-center gap-3">
            <BarChart3 className="w-6 h-6 text-primary-600" />
            <h2 className="text-2xl font-bold text-black">Score Card</h2>
          </div>
          <button
            onClick={onRefresh}
            disabled={loading}
            className="bg-primary-600 hover:bg-primary-700 disabled:bg-primary-400 text-white px-4 py-2 rounded-lg transition-colors duration-200 flex items-center gap-2"
          >
            <RefreshCw className={`w-4 h-4 ${loading ? 'animate-spin' : ''}`} />
            Refresh
          </button>
        </div>

        {/* Configuration Card */}
        {config && (
          <div className="bg-gray-50 rounded-lg p-6 mb-6 border border-gray-200">
            <div className="flex items-center gap-3 mb-4">
              <Settings className="w-5 h-5 text-primary-600" />
              <h3 className="text-lg font-semibold text-black">Bot Configuration</h3>
            </div>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-600 mb-1">Meeting URL</label>
                <p className="text-sm text-black break-all">{config.meetingUrl}</p>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-600 mb-1">Bot Name</label>
                <p className="text-sm text-black">{config.botName}</p>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-600 mb-1">Start Time</label>
                <p className="text-sm text-black">{new Date(config.startTime).toLocaleString()}</p>
              </div>
            </div>
          </div>
        )}

        {loading && (
          <div className="flex items-center justify-center py-12">
            <RefreshCw className="w-8 h-8 text-primary-600 animate-spin" />
          </div>
        )}

        {error && (
          <div className="bg-red-50 border border-red-200 rounded-lg p-6">
            <p className="text-red-700">{error}</p>
          </div>
        )}

        {scoreData && !loading && (
          <div className="space-y-6">
            <div className="bg-gray-50 rounded-lg p-6 border border-gray-200">
              <h3 className="text-lg font-semibold text-black mb-4">Score Data</h3>
              <pre className="text-sm text-black bg-white rounded p-4 overflow-auto border border-gray-200">
                {JSON.stringify(scoreData, null, 2)}
              </pre>
            </div>

            {/* Structured display components */}
            {scoreData.scores && (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
                {Object.entries(scoreData.scores).map(([key, value]) => (
                  <div key={key} className="bg-gray-50 rounded-lg p-4 border border-gray-200">
                    <h4 className="text-primary-600 font-medium mb-2 capitalize">{key.replace(/([A-Z])/g, ' $1')}</h4>
                    <p className="text-2xl font-bold text-black">{String(value)}</p>
                  </div>
                ))}
              </div>
            )}
          </div>
        )}

        {!scoreData && !loading && !error && (
          <div className="text-center py-12">
            <BarChart3 className="w-12 h-12 text-gray-400 mx-auto mb-4" />
            <p className="text-gray-600">No score data available. Click refresh to fetch data.</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default ScorecardScreen;
